import classes from "./GalleryImageCard.module.scss"

const GalleryImageCard = ({ title, content, important }) => {
  return (
    <>
    <div className={classes.galleryimagecard}>
      <h1 style={{ color: important }}>{title}</h1>
      <p>{content}</p>
    </div>
    </>
  );
};

export default GalleryImageCard;
